import { View, Text, StyleSheet, ImageBackground } from "react-native";

export default function Dashboard() {
    return (
        <ImageBackground source={require('../../assets/BACKGROUND.png')} resizeMode='cover' style={styles.background}>
            <View style={styles.container}>
                <Text style={styles.text}>{'\t\t\t'}Goals{'\n\t'} Steps{'\t\t\t\t'} Calories
                    {'\n\t'} 10782 {'\t\t\t\t'}1992
                </Text>
            </View>
        </ImageBackground>
        
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: "column",
        paddingTop: 0.1,
        backgroundColor: 'transparent',
        padding: 8,
    },
    text: {
        fontSize: 25,
        height: 200,
        width: '100%',
        backgroundColor: 'transparent, .5',
        borderColor: 'white',
        shadowColor: 'deeppink', // Use shadowColor instead of boxShadow
        shadowOffset: { width: 0, height: 0 },
        shadowRadius: 20,
        borderWidth: 1,
        borderRadius: 4,
    },
    background: {
        flex: 1,
        resizeMode: 'cover',
    },
});
